import React from 'react';

const PracownikBox = ({ imie, nazwisko, stanowisko, opis, zdjecie }) => {
    return (
        <div className="pracownik-box">
            <div className="pracownik-image" style={{ backgroundImage: `url(${zdjecie})` }}></div>
            <div className="pracownik-info">
                <h4>{imie} {nazwisko}</h4>
                <p>{stanowisko}</p>
                <p>{opis}</p>
            </div>
        </div>
    );
}

export default PracownikBox;
